import React, { Component } from 'react'
import { Link } from 'react-router'

import SessionStore from 'stores/session'
import IconButton from 'shared/iconButton'

class RegisteredRFC extends Component {
  // Renders each entry and adds them as a row in the table
  renderTableBody () {
    let taxableEntities = SessionStore.getTaxableEntities()
    let rows = taxableEntities.map((entry, index) => {
      return (
        <tr key={index}>
          <td className='align-left'>{entry.legal_name}</td>
          <td>{entry.rfc}</td>
          <td>
            <Link to={`/entidades/${entry.id}`}>
              <IconButton icon='pencil' tooltip='Editar' />
            </Link>
          </td>
        </tr>
      )
    })
    return <tbody>{rows}</tbody>
  }

  render () {
    return (
      <div className='columns'>
        <div className='column'>
          <table className='table'>
            <thead>
              <tr>
                <th className='align-left'>Razon Social</th>
                <th>RFC</th>
                <th />
              </tr>
            </thead>
            {this.renderTableBody()}
          </table>
        </div>
      </div>
    )
  }
}

export default RegisteredRFC
